# https://en.wikipedia.org/wiki/Pearson_correlation_coefficient
# https://en.wikipedia.org/wiki/Cosine_similarity
# https://en.wikipedia.org/wiki/Euclidean_distance

def pearson_correlation(v1, v2):
    cov_val = np.cov(v1, v2)
    return cov_val[0][1] / np.sqrt(cov_val[0][0] * cov_val[1][1])

def my_cosine_similarity(v1_1d, v2_1d):
    v1 = v1_1d.reshape(-1, 1)
    v2 = v2_1d.reshape(-1, 1)
    return (v1.T @ v2)/(np.sqrt(v1.T @ v1) * np.sqrt(v2.T @ v2))

def sqr_euclide_dist(v1, v2):
    t = v1 - v2
    return 1 / (1 + (t.T @ t))
